#ifndef _GNU_STUBS_SOFT_H
#define _GNU_STUBS_SOFT_H 1

#include <features.h>

/* This file defines some `*_soft' symbols that Glibc requires for
   binary compatibility with pre-2.0 shared objects.  */
#define _SOFT_STUB(x)
#define _SOFT_ALIAS(x)
#define _SOFT_ALIAS_VOID(x)
#define _SOFT_DEFAULT(x) = x

#endif /* _GNU_STUBS_SOFT_H */

